import React from 'react';
import './home.css'


function home () {
    return(
        <div>
            <div className='home'>
                <h1 className='titulo'>Bem vindo ao SIHMPLR</h1>
                <h2 className='subtitulo'>Você está na página principal, use a barra lateral para começar a usar o sisterma</h2>
            </div>
        </div>
    );
}

export default home;
